theta1 = theta_pos(1);
theta2 = theta_pos(2);
theta3= theta_pos(3);
theta4 = theta_pos(4);
theta5 = theta_pos(5);

% joint velocities
theta1_dot = theta_vel(1);
theta2_dot = theta_vel(2);
theta3_dot = theta_vel(3);
theta4_dot  = theta_vel(4);
theta5_dot = theta_vel(5);

% joint torques
u1 = torque(1);
u2 = torque(2);
u3 = torque(3);
u4 = torque(4);
u5 = torque(5);

